using LinearAlgebra

function jacobi2(A::Array{Float64, 2})
    (n, n) = size(A)
    A_copy = copy(A)
    previous_diagonal_length = typemax(Float64)
    current_diagonal_length_squared = 0
    eigenvalues = Array{Float64, 1}(undef, n)
    eigenvectors = Matrix{Float64}(I, n, n)
    while abs(previous_diagonal_length - current_diagonal_length_squared) > 0.001
        (s, t) = max_element_above_diagonal(A_copy)
        (sint, cost) = get_sin_cos(A_copy, s, t)
        R = Matrix{Float64}(I, n, n)
        R[s, s] = cost
        R[t, t] = cost
        R[s, t] = -sint
        R[t, s] = sint
        A_copy = transpose(R) * A_copy * R
        eigenvectors = eigenvectors * R
        
        previous_diagonal_length = current_diagonal_length_squared
        current_diagonal_length_squared = 0
        for i = 1:n
            eigenvalues[i] = A_copy[i, i]
            current_diagonal_length_squared += A_copy[i, i]^2
        end
    end

    return (sort!(eigenvalues), eigenvectors)
end

function max_element_above_diagonal(A::Array{Float64, 2})
    x::Int64 = 1
    y::Int64 = 2
    (n, n) = size(A)
    for c = 2:n, r = 1:c-1
        if abs(A[r, c]) > abs(A[x, y])
            x = r
            y = c
        end
    end
    return (x, y)
end

function get_sin_cos(A::Array{Float64, 2}, s::Int64, t::Int64)
    d = sqrt((A[s, s] - A[t, t])^2 + 4*A[s, t]^2)
    sin2t = 2*A[s, t] / d
    cos2t = (A[s, s] - A[t, t]) / d
    dt = sqrt(2 * (1 + cos2t))
    sint = abs(sin2t) / dt
    cost = sign(A[s, t]) * abs((1 + cos2t) / dt)
    return (sint, cost)
end

function jacobi!(A::Array{Float64, 2})
    (n, n) = size(A)
    identityMatrix = Matrix{Float64}(I, n, n)
    identity = copy(identityMatrix)
    precisionOfAlgorithm = 0.0001

    flag = true
    while flag
        flag = false

        (s, t) = max_element_above_diagonal(A)
        d = sqrt((A[s, s] - A[t, t])^2 + 4*A[s, t]^2)
        sin2t = 2*A[s, t] / d
        cos2t = (A[s, s] - A[t, t]) / d
        dt = sqrt(2 * (1 + cos2t))
        sint = abs(sin2t) / dt
        cost = sign(A[s, t]) * abs((1 + cos2t) / dt)

        s1 = copy(identityMatrix)

        s1[s, s] = cost
        s1[t, t] = cost
        s1[t, s] = sint
        s1[s, t] = -sint

        s1t = copy(s1)
        s1t[s, t] = s1[t, s]
        s1t[t, s] = s1[s, t]

        temp = zeros(n, n)
        for i=1:n, j=1:n
            sum = 0.0
            for p=1:n
                sum += s1t[i, p] * A[p, j]
            end
            temp[i, j] = sum
        end

        for i=1:n, j=1:n
            sum = 0.0
            for p=1:n
                sum += temp[i, p] * s1[p, j]
            end
            A[i, j] = sum
        end

        for i=1:n, j=1:n
            sum = 0.0
            for p=1:n
                sum += identity[i, p] * s1[p, j]
            end
            temp[i, j] = sum
        end

        identity = temp

        for i=1:n, j=1:n
            if i !== j && abs(A[i, j]) > precisionOfAlgorithm
                flag = true
            end
        end

    end

    eigenvalues = diag(A)
    eigenvectors::Vector{Vector{Float64}} = []

    for j=1:n
         push!(eigenvectors, identity[:,j])
    end

    return (sort!(eigenvalues), eigenvectors)

end

